import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend
} from 'chart.js';
import { Bar } from 'react-chartjs-2';
import './DocumentAnalysis.css';

// Регистрируем компоненты Chart.js
ChartJS.register(
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend
);

function DocumentAnalysis() {
  const [documents, setDocuments] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const navigate = useNavigate();
  const user = JSON.parse(localStorage.getItem('user'));

  useEffect(() => {
    const fetchDocuments = async () => {
      try {
        const response = await axios.get(`http://localhost:5000/api/documents`, {
          params: {
            userId: user.id,
            role: user.role
          }
        });
        setDocuments(response.data);
        setLoading(false);
      } catch (err) {
        console.error('Ошибка при загрузке документов:', err);
        setError(err.response?.data?.error || 'Ошибка при загрузке документов');
        setLoading(false);
      }
    };

    fetchDocuments();
  }, [user.id, user.role]);

  const handleLogout = () => {
    localStorage.removeItem('user');
    navigate('/login');
  };

  // Подготовка данных для графиков
  const prepareChartData = () => {
    // Группировка документов по годам
    const documentsByYear = documents.reduce((acc, doc) => {
      const year = new Date(doc.DateIssue).getFullYear();
      acc[year] = (acc[year] || 0) + 1;
      return acc;
    }, {});

    // Сортировка лет
    const years = Object.keys(documentsByYear).sort();
    const counts = years.map(year => documentsByYear[year]);

    // Расчет нарастающего итога
    const cumulativeCounts = counts.reduce((acc, count, index) => {
      acc[index] = index === 0 ? count : acc[index - 1] + count;
      return acc;
    }, []);

    return {
      years,
      counts,
      cumulativeCounts
    };
  };

  const chartData = prepareChartData();

  // Настройки для графика количества документов по годам
  const yearlyData = {
    labels: chartData.years,
    datasets: [
      {
        label: 'Количество документов',
        data: chartData.counts,
        backgroundColor: 'rgba(54, 162, 235, 0.5)',
        borderColor: 'rgba(54, 162, 235, 1)',
        borderWidth: 1,
      },
    ],
  };

  // Настройки для графика нарастающего итога
  const cumulativeData = {
    labels: chartData.years,
    datasets: [
      {
        label: 'Нарастающий итог документов',
        data: chartData.cumulativeCounts,
        backgroundColor: 'rgba(75, 192, 192, 0.5)',
        borderColor: 'rgba(75, 192, 192, 1)',
        borderWidth: 1,
      },
    ],
  };

  const options = {
    responsive: true,
    plugins: {
      legend: {
        position: 'top',
      },
      title: {
        display: true,
        text: 'Анализ документов',
      },
    },
    scales: {
      y: {
        beginAtZero: true,
      },
    },
  };

  if (loading) return <div className="loading">Загрузка...</div>;
  if (error) return <div className="error">{error}</div>;

  return (
    <div className="analysis-container">
      <div className="analysis-header">
        <h1>Анализ документов</h1>
        <button onClick={handleLogout} className="logout-button">Выйти</button>
      </div>
      
      <div className="charts-container">
        <div className="chart-wrapper">
          <h2>Количество документов по годам</h2>
          <Bar options={options} data={yearlyData} />
        </div>
        
        <div className="chart-wrapper">
          <h2>Нарастающий итог документов по годам</h2>
          <Bar options={options} data={cumulativeData} />
        </div>
      </div>
    </div>
  );
}

export default DocumentAnalysis;
